'use strict';
class DXFeedAuthorizeMessage {
    static create(token, requestNumberGenerator) {
        return "[{" + "\"id\":\"" + (requestNumberGenerator.getNextRequestNumber()).toString() + "\"," + "\"channel\":\"/meta/handshake\"," + "\"ext\":{" + "\"com.devexperts.auth.AuthToken\":\"" + token + "\"" + "}" + "}]";
    }
}
module.exports = DXFeedAuthorizeMessage
